import React from "react";

const skills = [
  {
    title: 'JavaScript ES6+'
  },
  {
    title: 'Python'
  },
  {
    title: 'React'
  },
  {
    title: 'TypeScript'
  },
  {
    title: 'Tailwind CSS'
  },
  {
    title: 'HTML/CSS'
  },
  {
    title: 'GIT'
  },
  {
    title: 'Azure DevOps'
  },
  {
    title: 'Figma'
  },
  {
    title: 'JavaScript ES6+'
  }
]
const About = () => {
    return (
      <section className="max-auto max-w-screen-xl text-center mx-auto bg-gray-100" style={{height: '500px'}}>
        <div className="w-full h-full box-border">
          <div className="w-full h-full flex justify-around">
            <div>
              <p>Hi 👋🏾! My name is Ruth but I prefer Alanna. I'm a developer at Travelopia, where I work to improve the 
                experience of yacht vacationing and the booking of exotic vacations on the modern web.
                Currently, I’ve been honing my skills learning the backend as I navigate through Lambda School's 18-month 
                intensive Fullstack Development program. Through my journey, I've come to find that the more I learn, the 
                more there is left to know. Outside of work however, I spend most of my time reading, writing and catching 
                up with Game of Thrones.</p>
            </div>
            <div>
              {skills.map(skill => (
                <div>
                  <p>{skill.title}</p>
                </div>
              ))}
            </div>
          </div> 
        </div>
      </section>
    );
}

export default About;
